import './App.css';
import {useState} from 'react';

export default function App() {
  const [sitesActive, setSitesActive] = useState(true);
  function handleSitesClick() {
    setSitesActive(current => !current);
  }

  return (
    <div className="App">
      <div className="LeftNav">
        <div className="LeftNavHeader">
          <span className="LeftNavHeaderOption">Sites</span>
          <span className="LeftNavHeaderOption">People</span>
        </div>
      </div>
      <div className="MiddleNav"></div>
    </div>
  );
}
